import React from 'react';
import './Header.css';


function Header() {
  return (
    <div className='header'>
        <div className='logo'>
            <h1>SnapLib</h1>
        </div>
        <div className='navb'>
            <h3>Home</h3>

            &nbsp; &nbsp;
            <h3>Photography</h3>
            <h3>Gallery</h3>
            <h3>About</h3>
            <h3>Contact</h3>
        </div>
    </div>
  );
};

export default Header;
